import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home">
      <h1>Welcome to My Personal Website</h1>
      <p>Explore my projects, gaming skills, and more!</p>
      <nav>
        <a href="/projects">Projects</a>
        <a href="/gaming">Gaming Skills</a>
      </nav>
    </div>
  );
}

export default Home;
